INSERT INTO `st_information_description` (`information_id`, `language_id`, `title`, `description`, `meta_title`, `meta_h1`, `meta_description`, `meta_keyword`) VALUES (4,1,'О нас','&lt;p style=&quot;margin-top: 4px; margin-bottom: 10px; font-family: Arial, Helvetica, sans-serif; font-size: 13.3333px;&quot;&gt;&lt;strong&gt;&amp;nbsp;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;Happy &amp;amp; Shopping - Ваш поставщик счастья&lt;/strong&gt;&lt;/p&gt;&lt;hr style=&quot;height: 1px; color: gray; font-family: Arial, Helvetica, sans-serif; font-size: 13.3333px;&quot;&gt;&lt;p style=&quot;margin-top: 4px; margin-bottom: 10px; font-family: Arial, Helvetica, sans-serif; font-size: 13.3333px;&quot;&gt;Именно такой мы видим&amp;nbsp;&lt;strong&gt;миссию нашего магазина&lt;/strong&gt;&amp;nbsp;-&amp;nbsp;предложить Вам такую вещь гардероба, которая будет обязательно приносить Вам радость и не будет пилиться в домашнем шкафу.&lt;/p&gt;&lt;p style=&quot;margin-top: 4px; margin-bottom: 10px; font-family: Arial, Helvetica, sans-serif; font-size: 13.3333px;&quot;&gt;Говорят, счастье не купишь за деньги. Но мы-то знаем, что это утверждение верно только отчасти. Разве не счастье – держать в руках по-настоящему&amp;nbsp;&lt;strong&gt;«свою»&lt;/strong&gt;&amp;nbsp;вещь? Разве не в радость ходить по городу в качественной и удобной обуви? Разве не приятно ощущать телом нежную ткань и видеть идеальный крой? Мы знаем, какое это удовольствие. Потому что&amp;nbsp;&lt;strong&gt;мы – такие же, как и вы!&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 4px; margin-bottom: 10px; font-family: Arial, Helvetica, sans-serif; font-size: 13.3333px;&quot;&gt;За время работы нашего магазина, мы научились выбирать для клиентов исключительно&amp;nbsp;&lt;strong&gt;качественные и практичные&lt;/strong&gt;&amp;nbsp;вещи американских и европейских брендов. Мы знаем&amp;nbsp;&lt;strong&gt;предпочтения&lt;/strong&gt;&amp;nbsp;наших клиентов и всегда стараемся им соответсвовать.&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 4px; margin-bottom: 10px; font-family: Arial, Helvetica, sans-serif; font-size: 13.3333px;&quot;&gt;&lt;strong&gt;Happy Shopping&lt;/strong&gt;&amp;nbsp;– магазин для любителей&lt;strong&gt;&amp;nbsp;счастливого шопинга&lt;/strong&gt;. Такого, когда сердце замирает от восторга, и не хочется останавливаться.&lt;/p&gt;&lt;p style=&quot;margin-top: 4px; margin-bottom: 10px; font-family: Arial, Helvetica, sans-serif; font-size: 13.3333px;&quot;&gt;Мы по уши влюблены в свою работу. Мы всегда рады Вас видеть в нашем Шоуруме или общаться с Вами по телефону.&lt;/p&gt;&lt;p style=&quot;margin-top: 4px; margin-bottom: 10px; font-family: Arial, Helvetica, sans-serif; font-size: 13.3333px;&quot;&gt;&lt;strong&gt;Счастливого Вам шопинга!&lt;/strong&gt;&amp;nbsp;&lt;/p&gt;\r\n','О нас','О нас',' Happy &amp; Shopping - Ваш поставщик счастья',''),(5,1,'Условия соглашения','&lt;p&gt;\r\n	Условия соглашения&lt;/p&gt;\r\n','','','',''),(3,1,'Политика безопасности','&lt;p&gt;\r\n	Политика безопасности&lt;/p&gt;\r\n','','','',''),(6,1,'Информация о доставке','&lt;p style=&quot;margin-top: 4px; margin-bottom: 10px; font-family: Arial, Helvetica, sans-serif; font-size: 13.3333px;&quot;&gt;Доставка товаров осуществляется в течении&lt;strong&gt;&amp;nbsp;1-2 дней&amp;nbsp;&lt;/strong&gt;с момента заказа товара на сайте и по&lt;strong&gt;&amp;nbsp;предварительной предоплате.&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 4px; margin-bottom: 10px; font-family: Arial, Helvetica, sans-serif; font-size: 13.3333px;&quot;&gt;Способы доставки:&lt;/p&gt;&lt;ul style=&quot;font-family: Arial, Helvetica, sans-serif; font-size: 13.3333px;&quot;&gt;&lt;li&gt;&lt;strong&gt;Самовывоз (Киев)&lt;strong&gt;&lt;strong&gt;​&lt;/strong&gt;&lt;/strong&gt;&lt;/strong&gt;&lt;/li&gt;&lt;li&gt;&lt;strong&gt;Доставка курьером (возможна только по Киеву)&lt;/strong&gt;&lt;p style=&quot;margin-top: 4px; margin-bottom: 10px;&quot;&gt;Ваш заказ будет доставлен по указанному адресу в заранее оговорённое время. Стоимость доставки зависит от многих факторов и в среднем составляет 100 грн.&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;strong&gt;НОВА ПОШТА&lt;/strong&gt;&lt;p style=&quot;margin-top: 4px; margin-bottom: 10px;&quot;&gt;При заказе на сумму&amp;nbsp;&lt;strong&gt;менее 1500 грн&lt;/strong&gt;, доставка осуществляется за счет покупателя. Мы не можем указать точную стоимость доставки товара, так как она зависит от расстояния, габаритов, веса, цены или других параметров заказа.&amp;nbsp;&lt;/p&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p style=&quot;margin-top: 4px; margin-bottom: 10px; font-family: Arial, Helvetica, sans-serif; font-size: 13.3333px;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;Бесплатная доставка возможна при заказе на сумму&amp;nbsp;&lt;strong&gt;более 1500 грн&lt;/strong&gt;.&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 4px; margin-bottom: 10px; font-family: Arial, Helvetica, sans-serif; font-size: 13.3333px;&quot;&gt;Регионы доставки:&lt;/p&gt;&lt;ul style=&quot;font-family: Arial, Helvetica, sans-serif; font-size: 13.3333px;&quot;&gt;&lt;li&gt;&lt;strong&gt;Украина, все регионы&lt;/strong&gt;&lt;/li&gt;&lt;/ul&gt;\r\n','Информация о доставке','Информация о доставке','Информация о доставке',''),(7,1,'Способы оплаты','&lt;p style=&quot;margin-top: 4px; margin-bottom: 10px; font-family: Arial, Helvetica, sans-serif; font-size: 13.3333px;&quot;&gt;Способы оплаты:&lt;/p&gt;&lt;ul style=&quot;font-family: Arial, Helvetica, sans-serif; font-size: 13.3333px;&quot;&gt;&lt;li&gt;&lt;strong&gt;Наличными (только Киев)&lt;/strong&gt;&lt;p style=&quot;margin-top: 4px; margin-bottom: 10px;&quot;&gt;Оплатить наличными Вы можете непосредственно в нашем офисе, который находится в Киеве.&lt;/p&gt;&lt;hr style=&quot;height: 1px; color: gray;&quot;&gt;&lt;p style=&quot;margin-top: 4px; margin-bottom: 10px;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;strong&gt;Безналичный расчет&lt;/strong&gt;&lt;p style=&quot;margin-top: 4px; margin-bottom: 10px;&quot;&gt;&lt;strong&gt;Для владельцев карты «Приват Банка»&lt;/strong&gt;&amp;nbsp;- предлагаем&amp;nbsp;Вам воспользоваться системой «Приват 24» и совершить покупку даже не выходя из дома.&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 4px; margin-bottom: 10px;&quot;&gt;&lt;strong&gt;Номер карты «Приват Банка»: 5168 7551 1237 7466&lt;/strong&gt;&lt;strong&gt;&amp;nbsp;Гавриленко Анна.&lt;/strong&gt;&amp;nbsp;Назначение платежа: Оплата за товар.&lt;/p&gt;&lt;hr style=&quot;height: 1px; color: gray;&quot;&gt;&lt;p style=&quot;margin-top: 4px; margin-bottom: 10px;&quot;&gt;Если Вы&amp;nbsp;&lt;strong&gt;не являетесь клиентом «Приват Банка»&lt;/strong&gt;, оплатить заказ можно так же через терминал на наш&amp;nbsp;&lt;strong&gt;расчетный счет: 26007056109140&lt;/strong&gt;&amp;nbsp;ФЛП Гавриленко Анна Валериевна.&amp;nbsp;&amp;nbsp;&lt;/p&gt;&lt;/li&gt;&lt;/ul&gt;','Оплата','Оплата','',''),(8,1,'Возврат товара','&lt;p style=&quot;margin-top: 4px; margin-bottom: 10px; font-family: Arial, Helvetica, sans-serif; font-size: 13.3333px;&quot;&gt;Возврат товара возможен в течении&amp;nbsp;&lt;strong&gt;14 календарных дней&lt;/strong&gt;&amp;nbsp;с момента его доставки (получения курьером). Обращаем Ваше внимание на то, что товар подлежит возврату только при условии сохранения его товарного вида: &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;/p&gt;&lt;ul style=&quot;font-family: Arial, Helvetica, sans-serif; font-size: 13.3333px;&quot;&gt;&lt;li&gt;​​​&lt;strong&gt;отсутствия следов носки; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;/strong&gt;&lt;/li&gt;&lt;li&gt;&lt;span style=&quot;color: rgb(39, 41, 44);&quot;&gt;&lt;strong&gt;наличие оригинальной и неповрежденной упаковки и ярлыков. &amp;nbsp; &amp;nbsp;&lt;/strong&gt;&amp;nbsp;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;/span&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p style=&quot;margin-top: 4px; margin-bottom: 10px; font-family: Arial, Helvetica, sans-serif; font-size: 13.3333px;&quot;&gt;&lt;span style=&quot;color: rgb(39, 41, 44);&quot;&gt;Возврату&amp;nbsp;&lt;strong&gt;не подлежат&lt;/strong&gt;&amp;nbsp;некоторые категории товаров (указанные в Приложении № 3 к Постановлению Кабинета Министров Украины от 19 марта 1994 г. М 172.): &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;ul style=&quot;font-family: Arial, Helvetica, sans-serif; font-size: 13.3333px;&quot;&gt;&lt;li&gt;&lt;strong&gt;парфюмерно-косметические изделия &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;/strong&gt;&lt;/li&gt;&lt;li&gt;&lt;strong&gt;перчатки &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbs