&gt;&lt;/li&gt;&lt;li&gt;&lt;strong&gt;чулочно-носочные изделия.&lt;/strong&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p style=&quot;margin-top: 4px; margin-bottom: 10px; font-family: Arial, Helvetica, sans-serif; font-size: 13.3333px;&quot;&gt;Для возврата товара, заполните, пожалуйста, форму по &lt;a href=&quot;index.php?route=account/return/add&quot;&gt;&lt;font color=&quot;#3984c6&quot;&gt;ссылке&lt;/font&gt;&lt;/a&gt;&lt;/p&gt;','Возврат товара','Возврат товара','Возврат товара',''),(9,1,'Размеры','&lt;h2 style=&quot;font-size: 16pt; font-family: cuprum; text-transform: uppercase; font-weight: bold; padding-bottom: 8px; color: rgb(215, 21, 13);&quot;&gt;ЖЕНСКАЯ ОДЕЖДА&lt;/h2&gt;&lt;p style=&quot;margin-top: 4px; margin-bottom: 10px; font-family: Arial, Helvetica, sans-serif; font-size: 13.3333px;&quot;&gt;&lt;img alt=&quot;&quot; src=&quot;http://happyshopping.com.ua/userfiles/size_f.png&quot; style=&quot;height: 380px; width: 762px;&quot;&gt;&lt;/p&gt;&lt;h2 style=&quot;font-size: 16pt; font-family: cuprum; text-transform: uppercase; font-weight: bold; padding-bottom: 8px; color: rgb(215, 21, 13);&quot;&gt;МУЖСКАЯ ОДЕЖДА&lt;/h2&gt;&lt;p style=&quot;margin-top: 4px; margin-bottom: 10px; font-family: Arial, Helvetica, sans-serif; font-size: 13.3333px;&quot;&gt;&lt;img alt=&quot;&quot; src=&quot;http://happyshopping.com.ua/userfiles/size_m.png&quot; style=&quot;height: 380px; width: 762px;&quot;&gt;&lt;/p&gt;','Размеры','Размеры','Размеры','');
