INSERT INTO `st_modification` (`modification_id`, `name`, `code`, `author`, `version`, `link`, `xml`, `status`, `date_added`) VALUES (1,'Social icons VT 2.3','social_icons_vt23','VT Studio','2.3','http://vt-studio.com','<?xml version=\"1.0\" encoding=\"utf-8\"?>\r\n<modification>\r\n    <code>social_icons_vt23</code>\r\n	<name>Social icons VT 2.3</name>\r\n    <version>2.3</version>\r\n    <author>VT Studio</author>\r\n    <link>http://vt-studio.com</link>\r\n	<file path=\"catalog/controller/common/footer.php\">\r\n        <operation error=\"scip\">\r\n            <search><![CDATA[\r\n            return $this->load->view(\'common/footer\', $data);\r\n            ]]></search>\r\n            <add position=\"before\"><![CDATA[\r\n           //start social vt\r\n        $this->load->model(\'setting/setting\');\r\n        $social_icons_vt = $this->model_setting_setting->getSetting(\'social_icons_vt\') ? $this->model_setting_setting->getSetting(\'social_icons_vt\')[\'social_icons_vt\'] : $social_icons_vt = false;\r\n        if($social_icons_vt != false){\r\n            $this->document->addStyle(\'catalog/view/theme/default/stylesheet/social_icons_vt.css\');\r\n            $html = \'<div class=\"social_icons_vt\">\';\r\n                foreach ($social_icons_vt as $key => $icon_vt){\r\n					if($icon_vt){\r\n						$html .= \'<a class=\"icon_vt \' . $key . \'\" href=\"\'. $icon_vt . \'\" target = \"_blanck\"></a>\';\r\n					}\r\n				}\r\n            $html .= \'</div>\';\r\n            $data[\'social_icons_vt\'] = $html;\r\n        }else{\r\n            $data[\'social_icons_vt\'] = false;\r\n        }\r\n        //end social vt\r\n            ]]></add>\r\n        </operation>\r\n    </file>\r\n	<file path=\"catalog/view/theme/*/template/common/footer.tpl\">\r\n        <operation>\r\n            <search><![CDATA[\r\n			<p><?php echo $powered; ?></p>\r\n			]]></search>\r\n			<add position=\"replace\"><![CDATA[\r\n            <div class=\"col-sm-3\"><p><?php echo $powered; ?></p></div>\r\n			<div class=\"col-sm-9 social_icons_vt_9\"><?php echo $social_icons_vt; ?></div>\r\n			]]></add>\r\n		</operation>\r\n    </file>\r\n</modification>',1,'2019-01-16 16:01:58'),(3,'Custom Quick Checkout','customquickcheckout','<a href=\"https://opencart2x.ru\" target=\"_blank\">opencart2x.ru</a','7.0','https://opencart2x.ru','<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<modification>\n	<name>Custom Quick Checkout</name>\n	<code>customquickcheckout</code>\n	<version>7.0</version>\n	<author><![CDATA[<a href=\"https://opencart2x.ru\" target=\"_blank\">opencart2x.ru</a>]]></author>\n	<link>https://opencart2x.ru</link>\n	\n    <file path=\"catalog/controller/checkout/checkout.php\">\n        <operation error=\"skip\">\n            <search ><![CDATA[if (file_exists(DIR_TEMPLATE . $this->config->get(\'config_template\') . \'/template/checkout/checkout.tpl\')) {]]></search>\n			<add position=\"replace\" offset=\"4\"><![CDATA[\n			// a_vqmod_d_quickcheckout.xml\n			if($this->config->get(\'d_quickcheckout_status\')){\n				$template = \'d_quickcheckout\';\n			}else{\n				$template = \'checkout\';\n			}\n			\n			if (file_exists(DIR_TEMPLATE . $this->config->get(\'config_template\') . \'/template/checkout/\'.$template.\'.tpl\')) {\n				$template = $this->config->get(\'config_template\') . \'/template/checkout/\'.$template.\'.tpl\';\n			} else {\n				$template = \'default/template/checkout/\'.$template.\'.tpl\';\n			}\n			$this->response->setOutput($this->load->view($template, $data));]]>\n			</add>\n        </operation>\n    </file>\n    <file path=\"catalog/controller/checkout/checkout.php\">\n        <operation error=\"skip\">\n			<search><![CDATA[$this->response->setOutput($this->load->view(\'checkout/checkout\', $data));]]></search>\n			<add position=\"replace\"><![CDATA[\n			// a_vqmod_d_quickcheckout.xml\n			if($this->config->get(\'d_quickcheckout_status\')){\n				$template = \'d_quickcheckout\';\n			}else{\n				$template = \'checkout\';\n			}\n			\n			$this->response->setOutput($this->load->view(\'checkout/\'.$template, $data));]]></add>\n		</operation>\n	</file>\n	<file path=\"catalog/controller/checkout/checkout.php\">\n		<operation>\n			<search ><![CDATA[$data[\'header\'] = $this->load->controller(\'common/header\');]]></search>\n			<add position=\"before\"><![CDATA[\n		if($this->config->get(\'d_quickcheckout_status\')){\n			$data[\'d_quickcheckout\'] = $this->load->controller(\'extension/module/d_quickcheckout\');\n		}\n		]]></add>\n		</operation>\n    </file>\n    <file path=\"system/library/cart/tax.php\">\n		<operation error=\"skip\">\n			<search ><![CDATA[final class Tax {]]></search>\n			<add position=\"after\"><![CDATA[\n	// a_vqmod_d_quickcheckout.xml\n	public function clearRates(){\n		$this->tax_rates = array();\n	}\n			]]></add>\n		</operation>\n	</file>	\n	<file path=\"system/library/tax.php\">\n		<operation error=\"skip\">\n			<search ><![CDATA[final class Tax {]]></search>\n			<add position=\"after\"><![CDATA[\n	// a_vqmod_d_quickcheckout.xml\n	public function clearRates(){\n		$this->tax_rates = array();\n	}\n			]]></add>\n		</operation>\n	</file>	\n</modification>',1,'2019-02-12 17:13:24');
