е<br />\r\n<strong>Начальная нота:</strong> Белая смородина, Калон, Малина, Мандарин, Сицилийский лимон<br />\r\n<strong>Нота сердца:</strong> Апельсиновый цвет, Белая фрезия, Жасмин, Магнолия<br />\r\n<strong>Конечная нота:</strong> Амброксан, Древесные ноты, Мускус, Пачули</p>','','','','',''),(7475,1,'Косметичка \"Graffiti\" Victoria\'s Secret','<p>Косметичка \"Graffiti\" Victoria\'s Secret</p>\r\n\r\n<p>Размер - 17 см / 8 см / 9 см</p>','','','','',''),(7476,1,'Розовая косметичка \"Love\" Victoria\'s Secret','<p>Розовая косметичка \"Love\" Victoria\'s Secret</p>\r\n\r\n<p>Размер - 17 см / 8 см / 9 см</p>','','','','',''),(7477,1,'Парфюм \"Bombshell\" Victoria\'s Secret','<p>Парфюм \"Bombshell\" Victoria\'s Secret</p>\r\n\r\n<p>Объем - 30 мл</p>\r\n\r\n<p>Аромат Victoria\'s Secret Bombshell подарит своей обладательнице чувство радости и счастья, окружит её лаской и любовью... Вместе с превосходным парфюмом Victoria\'s Secret Bombshell каждая девушка сможет почувствовать себя настоящей звездой Голливуда — прекрасной и блистательной. Этот аромат способен подчеркнуть и приумножить шарм и обаяние свой владелицы.</p>\r\n\r\n<p>Характер: роскошный, сексуальный.</p>\r\n\r\n<p>Группа ароматов: цветочные, фруктовые.</p>\r\n\r\n<p>Содержит ноты: маракуйя.</p>\r\n\r\n<p>Ноты сердца: желтый пион.</p>\r\n\r\n<p>Базовые ноты: ванильная орхидея.</p>','','','','',''),(7478,1,'Парфюм в роллере \"Bombshell Shanghai\" Victoria\'s Secret','<p>Парфюм в роллере \"Bombshell Shanghai 2017\" Victoria\'s Secret</p>\r\n\r\n<p>Объем - 7 мл</p>\r\n\r\n<p>Victoria\'s Secret выделяет основные ноты композиции: лиловая маракуйя, пион Shangri-la и аккорд ванильной орхидеи</p>','','','','',''),(7479,1,'Парфюм в роллере \"Very Sexy\" Victoria\'s Secret','<p>Парфюм в роллере \"Very Sexy\" Victoria\'s Secret</p>\r\n\r\n<p>Объем - 7 мл</p>\r\n\r\n<p>Very Sexy Eau de Parfum - это опьяняющий аромат, включающий провокационные и изысканные ноты ванильной орхидеи, солнечного клементина и темной сочной ежевики.</p>','','','','',''),(7480,1,'Парфюм в роллере \"Tease\" Victoria\'s Secret','<p>Парфюм в роллере \"Tease\" Victoria\'s Secret<br />\r\nТип аромата : теплый<br />\r\nНоты : ваниль, груша, цветы гардении.</p>\r\n\r\n<p>Объем: 7мл </p>','','','','',''),(7481,1,'Парфюм \"Bombshell Nights\" Victoria\'s Secret','<p>Парфюм \"Bombshell Nights\" Victoria\'s Secret</p>\r\n\r\n<p>Объем - 30 мл</p>\r\n\r\n<p>Верхняя нота: Черная смородина; средняя нота: Георгина; базовая нота: Древесные ноты.</p>\r\n\r\n<p>Bombshell Nights — это женская композиция 2017 года, пополнившая популярную линейку Bombshell Collection. Цветочный фруктовый аромат выпущен в ноябре, перед зимними праздниками. Чувственный и свежий, сексуальный и искрящийся букет призван улучшить настроение и подарить вам и всем окружающим новогоднее настроение. Парфюм открывается игристыми переливами черной смородины. </p>\r\n\r\n<p>Они подобны фруктовому шампанскому: яркие, сочные и пьянящие. В сердце композиции проступают неожиданные ноты пурпурного георгина, неспешно растворяющиеся в золоте амброво-древесных мотивов. Bombshell Nights — это аромат-праздник, когда воздух просто искрится от улыбок, повсюду слышен смех, и хочется танцевать до самого утра.</p>','','','','',''),(7482,1,'Парфюм \"Tease\" Victoria\'s Secret','<p>Парфюм \"Tease\" Victoria\'s Secret</p>\r\n\r\n<p>Объем - 30 мл</p>\r\n\r\n<p>Ноты : Черная ваниль, замороженная груша и цветущие гардении</p>\r\n\r\n<p> </p>','','','','',''),(7483,1,'Парфюм \"Bombshell Paris\" Victoria\'s Secret','<p>Парфюм \"Bombshell Paris\" Victoria\'s Secret</p>\r\n\r\n<p>Объем - 30 мл</p>\r\n\r\n<p><strong>Ноты: </strong>французский кипарис, ночной цветущий жасмин, белый кедр</p>\r\n\r\n<p>Очень не легко оставаться чувственной, нежной и хрупкой в ритме больших и суетных городов.</p>\r\n\r\n<p>Поэтому, специально для жительниц мегаполисов, которые, не смотря ни на что, стремятся сохранить и подчеркнуть свою утонченность и женственность, бренд Victoria&rsquo;s Secret дарит нев